description:
Section 8 is an intense first-person shooter that gives players unprecedented strategic control over the battlefield, employing tactical assets and on-demand vehicle deliveries to dynamically alter the flow of combat. Set at the crossroads of a growing insurrection among its colonies, Earth dispatches the elite 8th Armored Infantry to turn the tide.
